import AdList from './components/AdList.js';
import AddAdForm from './components/AddAdForm.js';
import './App.css';


const App = () => {
    return (
        <div>
            <h1>Доска объявлений</h1>
            <AddAdForm />
            <AdList />
        </div>
    );
};

export default App;
